import React from 'react';
import {robots} from './robots.js';

const imgArr = [
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'},
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'},
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'}
]

const textB = [
	' and more on the way',
	' and counting',
	' with ' + Math.round(Math.random()*100)
	+ ','
	+ 3 * (Math.round(Math.random()*9))
	+ ','
	+ Math.round(Math.random()*9) 
	+ Math.round(Math.random()*9) 
	+ Math.round(Math.random()*9) 
	+ ' to go'
]

const randB = () => {
	return Math.round(Math.random()*(textB.length - 1));
}

const num = () => {
	return Math.round(Math.random()*(imgArr.length-1));	
}

const Banner = (props) => {
	return (
		<div>
			<div id='spacer'>{robots.length + ' resources' + textB[randB()] + '...'}</div>
			<div id='banner' title={imgArr[num()].text}></div>
		</div>
	);
}

export default Banner;
